package main

import (
	"bytes"
	"compress/gzip"
	"fmt"
	"io"
	"io/ioutil"
	"log"
	"os"
	"path/filepath"
	"sort"
	"strings"
)

var globalFiles = map[string][]byte{}

func main() {
	if len(os.Args) == 1 {
		showHelp()
		return
	}
	cmdLine := strings.ToLower(os.Args[1])
	if exeCmd(cmdLine) {
		return
	}
	if cmdLine == "bootstrap" {
		bootstrap()
		return
	}
	showHelp()
}

func showHelp() {
	for _, name := range cmdArr {
		fmt.Println("cango-cli", name)
	}
}

type marker struct {
	prefix string
	suffix string
}

var cmdMarker = newMarker("cmdArr")
var fileMapMarker = newMarker("init")

func newMarker(markerName string) marker {
	return marker{
		prefix: "// start_" + markerName,
		suffix: "// end_" + markerName,
	}
}

var (
	cmdText     = bootCmd()
	fileMapText = bootFileMap()
)

func bootCmd() string {
	cmdNames := cmdMarker.prefix + "\nvar cmdArr = []string{"
	_ = filepath.Walk(".", func(path string, info os.FileInfo, err error) error {
		if info.IsDir() && path != "." && strings.Count(path, "/") == 0 && strings.HasPrefix(path, ".") == false {
			cmdNames = cmdNames + "\"" + path + "\", "
		}
		return nil
	})
	cmdNames = cmdNames[:len(cmdNames)-2]
	return cmdNames + "}\n\n"
}
func bootFileMap() string {
	files := map[string]string{}
	var fileNames []string
	for _, cmdName := range cmdArr {
		_ = filepath.Walk("./"+cmdName, func(path string, info os.FileInfo, err error) error {
			name := splash(path) + path
			fileNames = append(fileNames, name)
			files[name] = bytesFormat(func() []byte {
				if info.IsDir() {
					return []byte{}
				}
				bd := strings.Builder{}
				wr, err := gzip.NewWriterLevel(&bd, gzip.BestCompression)
				if err != nil {
					log.Println(err)
				}
				bs, err := ioutil.ReadFile(path)
				if err != nil {
					log.Println(err)
				}
				_, err = wr.Write(bs)
				_ = wr.Close()
				if err != nil {
					log.Println(err)
				}
				return []byte(bd.String())
			}())
			return nil
		})
		sort.Strings(fileNames)
	}
	spaceCount := 1
	globalFilesName := "globalFiles"
	builder := fileMapMarker.prefix + "\nfunc init() {\n"
	for _, name := range fileNames {
		builder = builder + repeat(spaceCount) + globalFilesName + "[\"" + name + "\"] = " + files[name] + "\n"
	}
	return builder + "}\n\n"
}

func insertText(fullText, insertText string, textMarker marker) string {
	selfPrefix := strings.Index(fullText, textMarker.prefix)
	selfSuffix := strings.Index(fullText, textMarker.suffix)
	return fullText[:selfPrefix] + insertText + fullText[selfSuffix:]
}

func bootstrap() {
	selfName := "./cango-cli.go"
	self := func() string {
		self, err := ioutil.ReadFile(selfName)
		if err != nil {
			log.Println(err)
			return ""
		}
		return string(self)
	}()
	if self == "" {
		return
	}
	self = insertText(self, cmdText, cmdMarker)
	self = insertText(self, fileMapText, fileMapMarker)
	err := ioutil.WriteFile("./cango-cli.go", []byte(self), 0666)
	if err != nil {
		log.Println(err)
	}
}
func exeCmd(cmd string) (matched bool) {
	var names []string
	for k, _ := range globalFiles {
		if strings.Contains(k, "./"+cmd) {
			names = append(names, k)
		}
	}
	if len(names) == 0 {
		return false
	}
	sort.Strings(names)
	for _, name := range names {
		path := name
		dir := "./" + filepath.Dir(path)
		base := filepath.Base(path)
		isDir := !strings.Contains(base, ".")
		if isDir {
			dir = path
		}
		fileInfo, _ := os.Stat(dir)
		if fileInfo == nil {
			err := os.MkdirAll(dir, os.ModePerm)
			if err != nil {
				log.Println(err)
			} else {
				log.Println("create  dir", dir)
			}
		}
		if isDir {
			continue
		}
		newFile, err := os.Create(path)
		if err != nil {
			log.Println(err)
		}
		log.Println("create file", path)
		_, err = newFile.Write(func() []byte {
			bs, _ := ioutil.ReadAll(func() io.Reader {
				rd, _ := gzip.NewReader(bytes.NewReader(globalFiles[name]))
				return rd
			}())
			return bs
		}())
		if err != nil {
			log.Println(err)
		}
		_ = newFile.Close()
	}
	return true
}
func bytesFormat(bs []byte) string {
	if len(bs) == 0 {
		return "[]byte{}"
	}
	var builder = "[]byte{"
	for _, b := range bs {
		builder = builder + (fmt.Sprintf("%d, ", b))
	}
	builder = builder[0:len(builder)-2] + "}"
	return builder
}
func repeat(c int) (rs string) {
	for i := 0; i < c; i++ {
		rs = rs + "\t"
	}
	return rs
}

func splash(path string) string {
	if strings.Contains(path, "./") {
		return ""
	}
	return "./"
}

